    false,nt"url": null,nt"notes": "The SRTM Water Body Data files are a by-product
    of the data editing performed by the National Geospatial-Intelligence Agency (NGA)
    to produce the finished SRTM Digital Terrain Elevation Data Level 2 (DTED&#174 2).
    In accordance with the DTED&#174 2 specification, the terrain elevation data have
    been edited to portray water bodies that meet minimum capture criteria. Ocean, lake
    and river shorelines were identified and delineated. Lake elevations were set to
    a constant value. Ocean elevations were set to zero. Rivers were stepped down monotonically
    to maintain proper flow. After this processing was done, the shorelines from the
    one arc second (approx. 30-meter) DTED&#174 2 were saved as vectors in ESRI 3-D
    Shapefile format.",nt"license_title": null,nt"extras": [{ntt"key":
